  //Similar to componentDidMount and componentDidUpdate
  useEffect(() => {
    axios.get('http://localhost:4000/disp')
      .then(response => {
        console.log(response.data)
        setpropList(response.data);
      })
      .catch((error) => {
        console.log(error);
      })
  }, [])

